import React from "react";
import { ButtonStyle } from "../styles";

type NieuwAfspraakProps = {
  title: string;
};

type ButtonProps = {
    style: object;
}

const NieuwAfspraak: React.FC<NieuwAfspraakProps> = (props) => {

  return <button style={props}>{props.title}</button>;
};

export const Afspraken: React.FC = () => {
  return (
    <>
      <NieuwAfspraak title={"Maak een nieuw afspraak"} style={ButtonStyle}/>
      <input type="text" />
    </>
  );
};
